import React from 'react';
import { 
  Box, 
  Typography, 
  List, 
  ListItem, 
  ListItemIcon, 
  ListItemText,
  Divider
} from '@mui/material';
import DescriptionIcon from '@mui/icons-material/Description';

const FileList = ({ files }) => {
  if (!files || files.length === 0) {
    return null;
  }
  
  return (
    <Box>
      <Typography variant="h6" gutterBottom>
        Uploaded Documents
      </Typography>
      <List>
        {files.map((file, index) => (
          <React.Fragment key={file.file_id}>
            {index > 0 && <Divider />}
            <ListItem>
              <ListItemIcon>
                <DescriptionIcon />
              </ListItemIcon>
              <ListItemText 
                primary={file.filename} 
                secondary={`${file.chunk_count} chunks processed`} 
              />
            </ListItem>
          </React.Fragment>
        ))}
      </List>
    </Box>
  );
};

export default FileList;
